import Header from '../Header/Header'
import React, { useState } from 'react';
import '../Booking/Booking.css'
import axios from 'axios'

function Booking(){
    const [formData, setForm] = useState({
        name: "",
        email: "",
        phone: "",
        date: "",
        time: "",
        service: ""
    });

    const [error, setError] = useState({});
    const [confirmation, setConfirmation] = useState("");

    const handleChange = (e) => {
        const { name, value } = e.target;
        setForm((prevData) => ({
            ...prevData,
            [name]: value
        }));
        setError((prevError) => ({
            ...prevError,
            [name]: ""
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        const newError = {};
        if (!formData.name) newError.name = "Name is required";
        if (!formData.email) newError.email = "Email is required";
        if (!formData.phone) newError.phone = "Phone number is required";
        if (!formData.date) newError.date = "Date is required";
        if (!formData.time) newError.time = "Time is required";
        if (!formData.service) newError.service = "Service is required";

        if (Object.keys(newError).length > 0) {
            setError(newError);
            return;
        }

        try {
            const response = await axios.post('http://localhost:3001/bookAppointment', formData);
            setConfirmation("Your appointment has been booked successfully!");
            setForm({
                name: "",
                email: "",
                phone: "",
                date: "",
                time: "",
                service: ""
            });
        } catch (err) {
            console.error('Error booking appointment:', err);
            setError({ general: "There was an error booking your appointment. Please try again." });
        }
        
    };
    return(
        <div>
            <Header></Header>
        <div className="appointment-booking">
           
            <h1>Book an Appointment</h1>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="name">Name:</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                    />
                    {error.name && <p className="error">{error.name}</p>}
                </div>
                <div className="form-group">
                    <label htmlFor="email">Email:</label>
                    <input
                        type="email"
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                    />
                    {error.email && <p className="error">{error.email}</p>}
                </div>
                <div className="form-group">
                    <label htmlFor="phone">Phone:</label>
                    <input
                        type="tel"
                        id="phone"
                        name="phone"
                        value={formData.phone}
                        onChange={handleChange}
                    />
                    {error.phone && <p className="error">{error.phone}</p>}
                </div>
                <div className="form-group">
                    <label htmlFor="date">Date:</label>
                    <input
                        type="date"
                        id="date"
                        name="date"
                        value={formData.date}
                        onChange={handleChange}
                    />
                    {error.date && <p className="error">{error.date}</p>}
                </div>
                <div className="form-group">
                    <label htmlFor="time">Time:</label>
                    <input
                        type="time"
                        id="time"
                        name="time"
                        value={formData.time}
                        onChange={handleChange}
                    />
                    {error.time && <p className="error">{error.time}</p>}
                </div>
                <div className="form-group">
                    <label htmlFor="service">Service:</label>
                    <select
                        id="service"
                        name="service"
                        value={formData.service}
                        onChange={handleChange}
                    >
                        <option value="">Select a service</option>
                        <option value="consultation">Consultation</option>
                        <option value="checkup">Check-up</option>
                        <option value="therapy">Therapy</option>
                    </select>
                    {error.service && <p className="error">{error.service}</p>}
                </div>
                <button type="submit" className='book-btn'>Book Appointment</button>
            </form>
            {confirmation && <p className="confirmation">{confirmation}</p>}

            
        </div>
        </div>
    )
}

export default Booking
